import React from 'react'

import { Row, Col } from 'react-bootstrap'

import '../../styles/landingpage/header.scss'

export default function Header(props) {

  if ( props.viewport === 'xs' ) {
    return (
    <Row id="header">
      <Col xs={10}
           md={10}
           lg={10}
           id="header-businessnamecontainer">
       <h6>Trustee</h6>
      </Col>
       <Col xs={2}
            md={2}
            lg={2}
            id="header-productsearchbarcontainer">
        <div id="header-hamburger">
          <div className="header-hamburgerline">
                
          </div>
           <div className="header-hamburgerline">

          </div>
           <div className="header-hamburgerline">

          </div>
        </div>
      </Col>
    </Row>
    )
  } 

  if ( props.viewport === 'md' || props.viewport === 'lg' )
  return (
    <Row id="header">
      <Col xs={2}
           md={2}
           lg={2}
           id="header-businessnamecontainer">
       <h6>Trustee</h6>
      </Col>
       <Col xs={7}
            md={7}
            lg={8}
            id="header-productsearchbarcontainer">
        <Row id="header-productsearchbarcontainer-dropdownandsearchbarcontainer">
            <Col xs={2}
                 md={2}
                 lg={2}
                 id="header-productsearchbarcontainer-dropdowncontainer"> 
               <div id="header-productsearchbarcontainer-dropdowncontainer-maincontainer">
                  <p className="header-productsearchbarcontainer-dropdowncontainer-headerindication"
                     onClick={()=>{

                        const _dropdowncontainer = document.querySelector("#header-productsearchbarcontainer-dropdowncontainer-dropdowncontainer")

                        if ( _dropdowncontainer.style.display === 'none ') {
                          _dropdowncontainer.style.display = 'block'
                        } else {
                          _dropdowncontainer.style.display = 'none'
                        }

                     }}>Catalog &#8595;</p>
               </div>
               <div id="header-productsearchbarcontainer-dropdowncontainer-dropdowncontainer">
                 <p className="header-productsearchbarcontainer-dropdowncontainer-headerindication">Catalog</p>
                 <p className="header-productsearchbarcontainer-dropdowncontainer-headerindication">Sellers</p>
                 <p className="header-productsearchbarcontainer-dropdowncontainer-headerindication">Help Center</p>
               </div>
            </Col>
            <Col xs={10}
                 md={10}
                 lg={10}
                 id="header-productsearchbarcontainer-searchbarcontainer"> 
            </Col>
        </Row>
      </Col>
      <Col xs={7}
            md={7}
            lg={7}
            id="header-signinsignupandsellnowcontainer">
      </Col>
    </Row>
  )
}
